styles.value:
.d-ui-widget, .ui-widget, .d-node-content > * { color: #ffffff; }
.d-ui-widget, .ui-widget { background-image: none; background-color: #81cd32; }
.d-ui-widget, .ui-widget, .d-separator, .d-tooltip:before, .d-tooltip:after, .d-grid th, .d-grid td, .d-item-spliter { border-color: #6ca92d; }

.d-ui-widget-content, .ui-widget-content, .d-ui-widget-header.d-tabs-nav.d-state-active > a, .d-checkbox, .d-radio, .d-rating, a.d-button.link { color: #000000; }
.d-ui-widget.d-tooltip, .d-state-info, .d-item-counter { color: rgb(0, 0, 0); background-color: #f2fce9; background-image: none; border-color: #597e2a; }
.d-overlay { background-color: #f9fae5; background-image: none; }
.d-ui-widget-content, .ui-widget-content, .d-tabs-nav.d-state-active { background-color: #ffffff; background-image: none; }

.field-validation-error, .d-ui-widget.d-state-error, .input-validation-error > input, .d-state-error, .input-validation-error { color: #f8eae3; }
    .field-validation-error, .input-validation-error, .d-ui-widget.d-state-error, .d-ui-widget.d-state-error > .d-ui-widget-content, .input-validation-error > .d-ui-widget-content { background-color: #d67838; background-image: none; }
.field-validation-error, .d-ui-widget.d-state-error, .input-validation-error { border-color: #c01b1b; }
